export default function SearchBar({ lister }) {
    const [ SearchText, setSearchText ] = useState('');

    const handleSearchInputChange = event => {
        setSearchText(event.target.value);
     }

    const filteredSearch = lister.filter((list) => {
        return(
            list.map(list => {return(<div key={list.name}>{list.name}</div>)})
        )
    }
    );

    return (
        <div>
            <input id="SearchBar" type="text" placeholder="Search" onChange={handleSearchInputChange}></input>
        </div>
    )
}
